import React from "react";

import * as Styled from "./style";
import Tr from "../Tr";
import Th from "../Th";

const Table = ({ headData, bodyData }) => {
  let renderTableHeadData = () =>
    headData.map((data, i) => (
      <Th key={i} width={data.width}>
        {data.name}
      </Th>
    ));

  return (
    <Styled.Table>
      <thead>
        <Tr pad={[2, 0]}>{renderTableHeadData()}</Tr>
      </thead>
      <tbody></tbody>
    </Styled.Table>
  );
};

export default Table;
